The Wolfman (2010)

Verenigde Staten
Horror / Thriller
102 minuten

geregisseerd door Joe Johnston
met Anthony Hopkins, Benicio Del Toro en Emily Blunt

Als zijn broer plotseling verdwijnt, keert Lawrence Talbot (Benicio Del Toro) terug naar het huis van zijn vader John (Anthony Hopkins), dankzij Gwen Conliffe (Emily Blunt), de verloofde van zijn broer. Lawrence besluit te helpen om zijn broer te vinden. Maar als hij oog in oog komt te staan met de verantwoordelijke, een weerwolf, wordt hij gebeten en dus ook getroffen door deze gruwelijke vloek. Daarom het duurt niet lang voor Lawrence langzaam begint te transformeren...


